import React from 'react';
import './index.css';

function FlightCard(props) {
    return (
        <div className="flightCard">
            <h3>{props.flight}</h3>
            <hr/>
            <div className="ac">
                <div className="acTitle">
                    <h5>AC</h5>
                </div>
                <div className="acText">
                    <h5>Amelia Earheart</h5>
                </div>
            </div>
        </div>
    );
}

class Dashboard extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            flights: ["Thurs, May 2", "Fri, May 4"],
        };
    }

    renderUpcomingFlights() {
        var cards = []
        this.state.flights.forEach(flight => {
            cards.push(<FlightCard flight={flight}/>)
        });
        console.log(cards)
        return cards
    }
    render() { 
        return (
            <div>
                <h2>Upcoming Flights</h2>
                <div className="upcomingFlights">
                    {this.renderUpcomingFlights()}
                </div>
            </div>

        )
    };
}

export default Dashboard;
